(5, 'RAI8L7O44C', 583, 'ESCUELA DE KARATE, LIENCRES', 'El deporte es una herramienta pedagógica necesaria para el desarrollo integral de nuestros niños, jóvenes y adultos. Entre los extremos representados por la competición de alto nivel y el deporte recreativo, se encuentran el deporte educativo que pretende contribuir al desarrollo armónico y potenciar los valores del individuo.', 'Colegio \'\'Las Dunas\'\', Liencres', 'liencreas@escuelapielagos.es', '658059375', '', '', 1, '2022-03-13 19:47:06', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
